import { motion } from "framer-motion";

function Contact() {
  return (
    <section id="contact" className="py-20 px-4 text-center">
      <h2 className="text-4xl font-bold text-omnitrixGreen mb-6">Contact Me</h2>
      <p className="text-gray-300 mb-6">
        Email: <a href="mailto:you@example.com" className="text-omnitrixGreen">you@example.com</a>
      </p>
      <motion.a
        href="mailto:you@example.com"
        whileHover={{ scale: 1.1, boxShadow: "0 0 20px #00FF00" }}
        className="inline-block px-8 py-4 bg-omnitrixGreen text-white rounded shadow-lg font-bold"
      >
        Send Email
      </motion.a>
    </section>
  );
}

export default Contact;
